"use strict";

function spiralMatrixIII(rows, cols, rStart, cStart) {
    let ans = [[rStart, cStart]];
    if (rows * cols === 1) {
        return ans;
    }
    let k = 1;
    while (true) {
        for (let [dr, dc, dk] of [[0, 1, k], [1, 0, k], [0, -1, k + 1], [-1, 0, k + 1]]) {
            for (let i = 0; i < dk; i++) {
                rStart += dr;
                cStart += dc;
                if (0 <= rStart && rStart < rows && 0 <= cStart && cStart < cols) {
                    ans.push([rStart, cStart]);
                    if (ans.length === rows * cols) {
                        return ans;
                    }
                }
            }
        }
        k += 2;
    }
}
